\boxed{
\begin{aligned}
\frac{\sec x}{\sin x} - \frac{\sin x}{\cos x} &= \frac{1}{\cos x \sin x} - \frac{\sin x}{\cos x} \\
&= \frac{1 - \sin^2 x}{\sin x \cos x} \\
&= \frac{\cos^2 x}{\sin x \cos x} \quad (\text{since } 1 - \sin^2 x = \cos^2 x) \\
&= \frac{\cos x}{\sin x} \\
&= \cot x.
\end{aligned}
}
